        phone_adoption_rate = 0.8
    elif adoption_tier == 'Middle':
        phone_adoption_rate = 0.4
    elif adoption_tier == 'Lower':
        phone_adoption_rate = 0.2
    else:
        print('Did not recognize adoption_tier')

    phones = round(population * phone_adoption_rate)

    return phones

