def sqrt(number):


    if number is None or number < 0:
        return None

    if number * number == number or number == 1:
        return number

    lo = 0
    hi = number
    while lo < hi:
        mid = (lo + hi) >> 1
        if mid * mid == number:
            return mid
        elif mid * mid < number:
            lo = mid + 1
        else:
            hi = mid
    return lo - 1

