    if p is None or not isinstance(p, tuple):
        raise('The argument p must be a valid tuple.')

    if q is None or not isinstance(q, tuple):
        raise('The argument q must be a valid tuple.')

    return ((p[0] - q[0]) ** 2 + (p[1] - q[1]) ** 2) ** 0.5

