def dice_coef(pred, target, smoothing=1.0):

    intersection = (pred * target).sum(dim=(1, 2, 3))
    union = (pred + target).sum(dim=(1, 2, 3))

    return ((2 * intersection + smoothing) / (union + smoothing)).mean()

